import React, { Component } from 'react';
import Grid from '@material-ui/core/Grid'
import { stepCompleted } from "../redux/actions"
import { useDispatch, useSelector } from "react-redux"

import "../App.css"


const TodoSubList = (propsParent, props) => {
    const dispatch = useDispatch()
    console.log("props", props)
    let container =
        Object.keys(props).map(input =>

            <div className='container'>
                {console.log("props", props[input].step)}

                <div className="subitem1-container ">
                    {props[input].step}
                </div>
                <div className="subitem1-container ">
                    Date
                </div>
                <div className="subitem1-container ">
                    <div className="filler" style={{ width: `${props[input].completed}%` }}>
                    </div>
                </div>

                <div className="subitem1-container ">
                    <button type="submit" onClick={() => dispatch(stepCompleted(propsParent, props[input].step))}>Completed</button>
                </div>
                {console.log("propsStep", props[input].step)
                }
            </div>
        )

    console.log("returning")
    return container
}



export default TodoSubList;
